import React from "react";
import "./Banner.css";

function Banner() {
    return (
        <div className="Banner">
            <div className="mainSlogan">
                <span>
                    OPENSEA PRICE FINDER <br />
                </span>
                <span className="sloganSm">
                    오픈API를 통해, 사용자에게 NFT 정보를 제공합니다.
                </span>
            </div>
        </div>
    );
}

export default Banner;
